import React from 'react';
import Inventory from '../components/Inventory'
import axios from 'axios';

function Shop() {

    const baseURL =`http://localhost:3001/storeinventory`;

    let inventoryData;

    axios.get(baseURL).then((response) => {
         inventoryData=response.data;
         console.log(inventoryData);

         const inventoryRender = inventoryData;
    })
    
    return (

        <div classname='shopSection'>
            <center>
                <h1>Find out what's waiting for you today!</h1>
                <p>Puruse our wide variety of books! We are always restocking and buying what our customers want!</p>
            </center>


            <ul>
                {inventoryRender.map(book => {
                    return(
                        <li key={inventoryRender.bookid}>
                            {inventoryRender.book_name}
                        </li>
                    )
                })}
            </ul>
        </div>
    )

}

export default Shop;
